              <Route path="/login" component={Login} />
              <Route path="/cards" component={CreditCardForm} />
              <Route path="/getCard" component={getCard} />
              <Route path="/cards" component={addCard} />

            </Switch>
        </Router>
      </div>

  )
}

export default App;
